Tukey’s earliest papers coincide with his arrival at Princeton in 1937. Early papers consisted mostly of notes compiled from lectures he’d attended although most are complete papers. Several of the existing early papers include: 
                            On the Distribution of the Fractional Part of a Statistical Variable (1938); 
                            A Note on Linear Functionals and Correction to "A Note on Linear Functionals" (1938) with Ralph P. Boas; 
                            The Intrinsic Metric of a Polytope (1939); and 
                            Compactness in General Sp aces (1940).

Time series work within the series includes 
                            What Does the Mean-Square-Successive-Difference Measure When Applied to Time Series? (1950); 
                            The Spectral Representation and Transformation Properties with High Moments of Stationary Time Series (1953); 
                            Time Series Alanysis (Not Analysis) written with Bruce P. Bogert and M. J. R. Healy in 1962 and 
                            Can We Predict Where "Time Series" Should Go Next? (1978). There are several undated papers on time series with the Works Series as well.
